import axios from 'axios';
import React, { useEffect, useState }from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [albums, setAlbums] = useState('');
useEffect(()=>{
  axios.get("http://localhost:3333/albums")
  .then(res => albums);
}, [])
  return (
    <div className="App">
      <p>{setAlbums(albums)}</p>
    </div>
  );
}

export default App;
